paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 2);
            }

            return normalizedValue;
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 23 ? 23 : value));
            let normalizedValue = (value - 0) / (23 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 24);
            }

            return normalizedValue;
        }
    case 1:
        {
            value = (value < 50 ? 50 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 50) / (2000 - 50);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 50 ? 50 : (value > 4000 ? 4000 : value));
            let normalizedValue = (value - 50) / (4000 - 50);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0.01 ? 0.01 : (value > 0.99 ? 0.99 : value));
            let normalizedValue = (value - 0.01) / (0.99 - 0.01);
            return normalizedValue;
        }
    default:
        index -= 5;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].convertToNormalizedParameterValue(index, value);
            }
        }

        index -= this.p_01[0].getNumParameters();

        if (index < this.p_02.getNumParameters())
            return this.p_02.convertToNormalizedParameterValue(index, value);

        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 2);
            }

            {
                return 0 + value * (1 - 0);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 24);
            }

            {
                return 0 + value * (23 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 50 + value * (2000 - 50);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 50 + value * (4000 - 50);
            }
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.01 + value * (0.99 - 0.01);
            }
        }
    default:
        index -= 5;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].convertFromNormalizedParameterValue(index, value);
            }
        }

        index -= this.p_01[0].getNumParameters();

        if (index < this.p_02.getNumParameters())
            return this.p_02.convertFromNormalizedParameterValue(index, value);

        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 1:
        {
            v = (v > 2000 ? 2000 : (v < 50 ? 50 : v));
            return v;
        }
    case 2:
        {
            v = (v > 23 ? 23 : (v < 0 ? 0 : v));

            {
                const oneStep = 23 / 23;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 3:
        {
            v = (v > 0.99 ? 0.99 : (v < 0.01 ? 0.01 : v));
            return v;
        }
    case 4:
        {
            v = (v > 4000 ? 4000 : (v < 50 ? 50 : v));
            return v;
        }
    default:
        index -= 5;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].constrainParameterValue(index, value);
            }
        }

        index -= this.p_01[0].getNumParameters();

        if (index < this.p_02.getNumParameters())
            return this.p_02.constrainParameterValue(index, value);

        return value;
    }
}

